import styled from 'styled-components';

const Container = styled.div`
  position: fixed;
  width: 100vh;
  height: 40vh;
  background: black;
  top: 30%;
  left: 25%;
`;
const Card = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -25px 0 0 -25px;
  color: white;
`;
const Text = styled.span``;
const Type = styled.div``;
const Number = styled.div``;
const Expiration = styled.div``;
const Owner = styled.div``;

const CCMaker = () => {
  return (
    <Container>
      <Card>
        <Number>
          <Text>376916524164335</Text>
        </Number>
        <Expiration>
          <Text>10/20</Text>
        </Expiration>
        <Owner>
          <Text>Kiel Lemke</Text>
        </Owner>
        <Type>
          <Text>Visa</Text>
        </Type>
      </Card>
    </Container>
  );
};

export default CCMaker;
